import React, { useState } from "react";

function App() {
  const [changeHeading,setHeading] = useState("Hello")
  function change(){
    setHeading("submited")
    // return(document.querySelector("h1").innerHTML = "submited")
  }
  const [changeColor,setColor] = useState(false)
  function Color(){
    const isMouseOver = false
    setColor(()=>{isMouseOver ? {backgroundColor: "green"} : {backgroundColor: "black"}})

  }

  return (
    <div className="container">
      <h1>{changeHeading}</h1>
      <input type="text" placeholder="What's your name?" />
      <button style={{backgroundColor: "black"}}
      onClick={change}
      onMouseOver={Color}
      >Submit</button>
    </div>
  );
}

export default App;
